import React from 'react';
import avatar from './assets/imgs/avatar.jpeg';

function Navbar() {
  const handleClick = (e) => {
    e.preventDefault();
    const targetId = e.currentTarget.getAttribute('href').substring(1);
    const targetElement = document.getElementById(targetId);
    if (targetElement) {
      targetElement.scrollIntoView({
        behavior: 'smooth',
        block: 'start',
      });
    }
  };

  return (
    <nav className="navbar sticky-top navbar-expand-lg navbar-light bg-white" data-spy="affix" data-offset-top="510">
      <div className="container">
        <div className="mobile-nav-container" id="navbarSupportedContent">
          <ul className="navbar-nav mr-auto">
            <li className="nav-item">
              <a href="#home" onClick={handleClick} className="nav-link"><i className="ti-home"></i><span className="nav-link-text">Home</span></a>
            </li>
            <li className="nav-item">
              <a href="#about" onClick={handleClick} className="nav-link"><i className="ti-user"></i><span className="nav-link-text">About</span></a>
            </li>
            <li className="nav-item">
              <a href="#resume" onClick={handleClick} className="nav-link"><i className="ti-file"></i><span className="nav-link-text">Resume</span></a>
            </li>
          </ul>
          <ul className="navbar-nav brand d-none d-lg-flex">
            <img src={avatar} alt="" className="brand-img" />
            <li className="brand-txt">
              <h5 className="brand-title">Jenish</h5>
              <div className="brand-subtitle">Data Analyst | Data Scientist</div>
            </li>
          </ul>
          <ul className="navbar-nav ml-auto">
            <li className="nav-item">
              <a href="#blog" onClick={handleClick} className="nav-link"><i className="ti-thought"></i><span className="nav-link-text">Blog</span></a>
            </li>
            <li className="nav-item last-item">
              <a href="#contact" onClick={handleClick} className="nav-link"><i className="ti-email"></i><span className="nav-link-text">Contact</span></a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
